//---------------------------------------------------------------------------*

void GGS_counter_by_source::
_dotAssign_operation (const GGS_counter_by_source inOperand) {
  if (isBuilt () && inOperand.isBuilt ()) {
    if (count () == 0) {
      *this = inOperand ;
    }else{
      if (inOperand.count () > 0) {
        _insulateList () ;
        elementOf_GGS_counter_by_source * p = inOperand.firstObject () ;
        while (p != NULL) {
          macroValidPointer (p) ;
          GGS_string p_0 = p->source ;
          GGS_lstring  p_1 = p->name ;
          GGS_counter_obj  p_2 = p->counter ;
          _internalAppendValues (p_0, p_1, p_2) ;
          p = p->nextObject () ;
        }
      }
    }
  }
}

//---------------------------------------------------------------------------*

void GGS_counter_by_source::
_insulateList (void) {
  if (_shared ()) {
    cElement * _p = firstObject () ;
    _alloc () ;
    while (_p != NULL) {
      macroValidPointer (_p) ;
      _internalAppendValues (_p->source,
                                _p->name,
                                _p->counter) ;
      _p = _p->nextObject () ;
    }
  }
}

